import React from 'react';

import { View, Text, Button, Stack, Spacer } from 'core';

import './App.css';

function App() {
  return (
    <View className="App">
      <Stack horizontal divider padding="medium" spacing="medium">
        <Stack>
          <Text fontSize="xlarge">Large</Text>
          <Spacer fillColor="gray-1" size="small" />
          <Text fontSize="large">Large</Text>
          <Spacer fillColor="gray-1" size="small" />
          <Text fontSize="medium">Medium</Text>
          <Spacer fillColor="gray-1" size="small" />
          <Text>Default</Text>
          <Spacer fillColor="gray-1" size="small" />
          <Text fontSize="small">Small</Text>
        </Stack>
        <Stack>
          <Button title="Hello World" />
        </Stack>
      </Stack>
    </View>
  );
}

export default App;
